import React from "react";
import '../cssFile/NavBarList.css'
import {Animated} from "react-animated-css";

export default function NavBarList(props) {
 switch (props.Page) {
   case "MyProfilePage":
    return (
      <Animated animationIn="zoomIn" animationOut="zoomOut" animationInDuration={2500} animationOutDuration={2500} isVisible={props.showOrHide}>
      <div className="BarList" id={props.showOrHide ? "Show" : "Hide"}>
        <ul className="list-group">
          <li disabled style={{color}} onClick={props.a} className="list-group-item" >My Profile</li>
          <li onClick={props.b} className="list-group-item">Contact Us</li>
          <li onClick={props.c} className="list-group-item">Log Out</li>
        </ul>
      </div>
      </Animated>
    );
     break;
 
   default:
     break;
 }
}
